import React from "react";

function LeftSideMenu() {
  return (
    <aside>
      <ul cla>
        <li className="side-li">HOME</li>
        <li className="side-li">SETTINGS</li>
        <li className="side-li">CONTACT US</li>
      </ul>
    </aside>
  );
}

export default LeftSideMenu;
